import React from 'react';
import '../stylesheets/home.scss';

class AboutMe extends React.Component {
  render() {
    return (
    <div className="aboutMe">
      <div>      
        <h2>Mi formación</h2>
      <p>En 2015 me gradué en el grado de Traducción e Interpretación</p>
      </div>

    </div>
    );
  }
}

export default AboutMe;
